import React from 'react';
import {Field,reduxForm} from 'redux-form';
class PlanCreate extends React.Component{
    renderInput(){
        return(
        <div>
            <input/>
        </div>);
    }
    renderInputs() {
        return(<div>
            <form>
                <input type="radio" name="gender" value="male" checked/> Male<br/>
                <input type="radio" name="gender" value="female"/> Female<br/>
  <input type="radio" name="gender" value="other"/> Other  
</form> 
        </div>);
    }
    render()
        {
        return (<form>
            <Field name="Age" component={this.renderInput}/>
            <Field name="Weight"  component={this.renderInput}/>
            <Field name="Height"  component={this.renderInput}/>
            <Field name="Plan"  component={this.renderInput}/>
        </form>);
        }
}
export default reduxForm({
    form:'PLANCREATE'
})(PlanCreate);
